import React from 'react';

import WinnersTableRow from 'components/commons/WinnersTableRow/WinnersTableRow';
import Pagination from 'components/commons/Pagination/Pagination';

import styles from './WinnersTable.module.scss';

function WinnersTable({ list }) {
   const [ pageNo, setPageNo ] = useState( 1 ); 
   
   const visibleitemsCount = 7;
   return(
      <>
         <table className = { styles.table } >
            <thead>
               <tr> 
                  <th>No</th>
                  <th>Car</th>
                  <th>Name</th>
                  <th>Wins</th>
                  <th>Best Time</th>
               </tr>
            </thead>
            <tbody>
               { list.map( car => <WinnersTableRow key = { car.id } carData = { car } />) }
            </tbody>
         </table>
         <Pagination 
            count = { list.length } 
            pageNo = { pageNo }
            changePage = { ( No ) => handlePageChange( No ) }
            visibleitemsCount = { visibleitemsCount }
         />
      </>

   )
}

export default WinnersTable;
